import { Form, Input, Button } from "antd";

const LoginForm = () => {
  return (
    <>
      <Form>
        <Form.Item>
          <Input />
        </Form.Item>
        <Form.Item>
          <Input.Password />
        </Form.Item>
      </Form>
    </>
  );
};

export default LoginForm;
